port: 7892
socks-port: 7891
mixed-port: 7890
redir-port: 7893
tproxy-port: 7899
mode: rule
allow-lan: true
unified-delay: false
bind-address: '*'
log-level: debug
ipv6: true
geodata-mode: true
geo-auto-update: true
geo-update-interval: 24 
external-controller: 0.0.0.0:9090 
external-ui: dashboard/metacubexd
external-ui-name: xd
external-ui-url: "https://github.com/MetaCubeX/metacubexd/archive/refs/heads/gh-pages.zip"
tcp-concurrent: true
global-client-fingerprint: chrome
geox-url:
  geoip: "https://raw.githubusercontent.com/Chocolate4U/Iran-v2ray-rules/release/geoip.dat"
  geosite: "https://raw.githubusercontent.com/Chocolate4U/Iran-v2ray-rules/release/geosite.dat"
  mmdb: "https://raw.githubusercontent.com/Chocolate4U/Iran-clash-rules/release/geoip.metadb"
  asn: "https://raw.githubusercontent.com/Chocolate4U/Iran-v2ray-rules/geolite2/GeoLite2-ASN.mmdb"
find-process-mode: strict
enable-process: true
profile:
  store-selected: true
  store-fake-ip: true
  tracing: true
interface-name: ""
keep-alive-interval: 15 
experimental:
  quic-go-disable-gso: false
  quic-go-disable-ecn: false
  dialer-ip4p-convert: true
sniffer:
  enable: false
  sniffing:
    - tls
    - http
  skip-domain:
    - 'Mijia Cloud'
    - 'dlg.io.mi.com'
    - '+.apple.com'
    - '*.baidu.com'
  force-domain:
    - '+'
    - '+.google.com'
  port-whitelist:
    - 80
    - 443
    - 8000-9000
    
#system # gvisor / lwip
tun:
  enable: true
  stack: MIXED
  auto-route: true
  auto-detect-interface: true
  dns-hijack:
    - 114.114.114.114
    - 180.76.76.76
    - 119.29.29.29
    - 223.5.5.5
    - 8.8.8.8
    - 8.8.4.4
    - 1.1.1.1
    - 1.0.0.1
dns:
  enable: true
  listen: 0.0.0.0:53
  cache-algorithm: arc
  respect-rules: true
  ipv6: false
  prefer-h3: false
  default-nameserver:
    - 223.5.5.5
    - 114.114.114.114
  nameserver:
    - https://dns.cloudflare.com/dns-query
    - https://dns.google/dns-query
    - tls://223.5.5.5
    - tls://114.114.114.114
    - tls://119.29.29.29
    - tls://180.76.76.76
    - tls://217.218.155.155:53
  proxy-server-nameserver:
    - https://120.53.53.53/dns-query
    - https://223.5.5.5/dns-query
    - https://dns.google/dns-query
    - tls://one.one.one.one
  nameserver-policy:
    "rule-set:ir,private":
      - https://120.53.53.53/dns-query
      - https://223.5.5.5/dns-query
  enhanced-mode: fake-ip
  fake-ip-range: 198.18.0.0/16
  fake-ip-filter:
    - "*.lan"
    - "*.localdomain"
    - "*.example"
    - "*.invalid"
    - "*.localhost"
    - "*.test"
    - "*.local"
    - "*.home.arpa"
    - "+.msftconnecttest.com"

